(220, '___ADMIN_EDITOR___ABOUT', 1, '<table cellspacing="0" cellpadding="0" border="0">\r\n    <tbody>\r\n        <tr>\r\n            <td valign="top" align="left">\r\n            <p><font face="Times New Roman, Times, serif" size="5">About Us<br />\r\n            </font><font face="Times New Roman, Times, serif" size="2"><br />\r\n            </font></p>\r\n            <p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">Newport Cottages specializes in creating fine benchmade furniture that is not only unique in style and design, but unique in the method of construction and its finishes. Our children''s furnishings are sold through fine furniture showrooms and authorized dealers nationwide.</font></p>\r\n            <p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">Although we do not sell directly to the public, you may contact us and we will direct you to your nearest authorized dealer. Please visit our dealer locator page for additional information.</font></p>\r\n            <p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">If you are a Retailer or Design Professional and would like to become an authorized dealer, please contact us so we can forward an application and answer any questions you may have.&nbsp;</font></p>\r\n            <p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">Our Corporate Offices and Factory are located in Southern California. Please contact us with any questions or for further information.</font></p>\r\n            &nbsp;</td>\r\n            <td valign="top" align="left">&nbsp;<img hspace="20" height="380" width="228" alt="" src="/attachment/image/about_us_main(2).jpg" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>', 'Children''s Furnishings - About Us - Newport Cottages', 'Children''s Furnishings', 'Children''s Furnishings', 1, 'ab', 'about/view.html'),
(221, '___ADMIN_EDITOR___PRODUCT_INFORMATION', 1, '<font face="Arial" size="2"><img hspace="15" height="236" width="315" align="right" src="/attachment/image/Product_Info.jpg" alt="" /></font><font face="Arial" size="5">Product Information</font><br />\r\n<p align="justify"><font face="Arial" size="2">All of our furniture pieces are benchmade using quailty craftsmanship and traditional woodworking techniques such as mortise &amp; tenon </font><font face="Arial" size="2">joinery, rail and stile construction as well as inlaid raised panels. The term &quot;benchmade&quot; is used when an item is individually built from start to finish on the bench of a highly skilled carpenter. Artisans hand turn on a lathe all of the posts and legs for each piece of furniture. In an era of mass production, imports and computerized machinery, this is an art form seldom used by most furniture manufacturers.</font></p>\r\n<p align="justify"><font face="Arial" size="2">We use select domestic hardwoods and manufacture our furniture in the U.S. A hand rubbed finish is carefully applied to each piece before it is inspected by one of our quality control team members. Our company, and each of its members, takes pride in the integrity and quality of each piece of furniture.</font></p>', 'Newport Cottages Product Information ', '', '', 1, 'product_information', 'productinformation.html'),
(222, '___ADMIN_EDITOR___PRIVACYPOLICY', 1, '<table cellspacing="0" cellpadding="0" border="0" align="center">\r\n    <tbody>\r\n        <tr>\r\n            <td><img height="35" width="91" src="/newportcottages/attachment/image/headerprivacypolicy.gif" alt="" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<br />\r\nNewport Cottages&nbsp;(the &quot;Company&quot;), has created this Privacy Policy to inform you of our policies and practices regarding the privacy of information supplied by users, or collected by us from users of the Company''s web site, www.henredon.com. <br />\r\n<br />\r\nOur Company is committed to protecting your right to privacy and keeping your personal information secure when you interact with our web site. The Company reserves the right to modify or amend this Privacy Policy at any time and for any reason. <br />\r\n<br />\r\nIf you have any questions regarding our privacy policy or practices after reading this Privacy Policy, please contact us at <a href="mailto:customerservice@newportcottages.com">customerservice@newportcottages.com</a> or&nbsp;Newport Cottages 4111 Buchanan Street, Riverside, CA. 92503.&nbsp;<br />\r\n<br />\r\n<font color="#3366ff"><strong><span class="textbold">Disclosure of Personal Information</span></strong></font> <br />\r\n<br />\r\nOur company will never willfully sell, trade, rent, disclose, or make available personally identifiable information about you to any third party without first receiving your permission, except when we believe in good faith that the law requires it, or to protect the rights or property of the Company. We may, however, share such information with Summertree Interiors, Inc., our parent company. <br />\r\n<br />\r\n<strong><font color="#3366ff"><span class="textbold">Cookies</span></font></strong> <br />\r\n<br />\r\nOur Company utilizes &quot;cookies,&quot; which are small pieces of information that are stored by your browser on your computer''s hard drive. We use them to monitor traffic patterns and site usage, and to develop a more unique experience for you when you visit our web sites. Our cookies do not have the capability of &quot;stealing&quot; information from your hard drive. <br />\r\n<br />\r\n<strong><font color="#3366ff"><span class="textbold">Purchase Transactions</span></font></strong> <br />\r\n<br />\r\nWhen you purchase a brochure or catalog, we collect information such as your name, e-mail address and payment information. This is used to process and fulfill your order. All information submitted to us is transmitted over the Internet in an encrypted manner. Information from these transactions is not released to third parties. <br />\r\n<br />\r\n<strong><font color="#3366ff"><span class="textbold">Security</span></font></strong> <br />\r\n<br />\r\nOur Company understands that the security of your personal information is important to you. We utilize security measures such as firewalls and secure connections in an effort to safeguard this information. We cannot, however, guarantee complete security, as it does not exist on the Internet. <br />\r\n<br />\r\n<strong><font color="#3366ff"><span class="textbold">Children''s Privacy Policy</span></font></strong> <br />\r\n<br />\r\nYou must be 18 years or older to use the Company''s web site. If you are under 18 years of age, consult your parent or guardian before providing any information to any Internet web site.&nbsp;<br />\r\n<br />\r\n<span class="textbold">Newport Cottages&nbsp;Terms of Use Agreement</span> <br />\r\n<br />\r\nThis is a binding agreement (&quot;Agreement&quot;) between&nbsp;Newport Cottages&nbsp;(the &quot;Company&quot;) and you, the user (&quot;You&quot; or &quot;Your&quot;). Our web site is offered to you conditioned on your acceptance without modification of the terms, conditions, and notices contained herein. By using our web site, you confirm your acceptance of, and agree to be bound by, this Agreement and all such terms, conditions and notices. <br />\r\n<br />\r\n<span class="textbold">Modifications of these Terms of Use</span> <br />\r\n<br />\r\nOur Company reserves the right to change the terms, conditions and notices under which our web site is offered. You are responsible for regularly reviewing these terms and conditions. Your continued use of our web site after changes are posted constitutes your acceptance of this Agreement as modified by the posted changes. <br />\r\n<br />\r\n<span class="textbold">Privacy</span> <br />\r\n<br />\r\nBecause your privacy is important to you and to the Company, we will operate our web site in accordance with our Privacy Policy, which is posted on the web site. By consenting to the Terms of Use Agreement for our web site, you consent to this Privacy Policy. <br />\r\n<br />\r\n<span class="textbold">Online Selling Policy</span> <br />\r\n<br />\r\nThe Company may offer products or marketing materials for purchase through its web site. The purchase of these products and materials is governed by our stated Terms and Conditions. <br />\r\n<br />\r\n<span class="textbold">Compliance with Applicable Laws</span> <br />\r\n<br />\r\nYou agree to comply with all applicable local, state and federal laws, statutes and regulations regarding your use of the Company''s site. It is our policy to comply with all local, state and federal law. Therefore, the Company reserves the right at all times to disclose any information as necessary to satisfy any applicable law, regulation, legal process or governmental request. <br />\r\n<br />\r\n<span class="textbold">Use of Communications</span> <br />\r\n<br />\r\nYou agree not to submit, publish or transmit through the Company''s web site any content that is libelous, obscene, invasive of privacy, illegal, racially or ethnically discriminatory, or that would constitute or assist a criminal offense or tortious act. We reserve the right to pursue any action with respect to information posted on the Company''s web site which we believe is inappropriate in our sole discretion. We cannot, nor do we, control the information provided by users. By its very nature, other people''s information may be offensive, harmful, inaccurate, mislabeled or deceptively labeled. <br />\r\n<br />\r\nYou may not use any software or routine, including viruses or malicious codes, intended to damage or interfere with the proper operation of the Company''s web site. <br />\r\n<br />\r\n<span class="textbold">Product Information</span> <br />\r\n<br />\r\nAll prices displayed on the Company''s web site are quoted in U.S. dollars and are valid in the United States only. Sales taxes are assessed as applicable. <br />\r\n<br />\r\nWe reserve the right, without prior notice, to discontinue products, or change specifications and prices on products posted on the Company''s web site. Please confirm availability prior to purchasing any product. We reserve the right to limit the order quantity on any items without prior notice. <br />\r\n<br />\r\n<span class="textbold">Copyrights, Trademarks and Restrictions</span> <br />\r\n<br />\r\nAll material on this site, including, but not limited to items such as logos, illustrations, clips, images, text and specifications are the property of the Company, and is protected by United States and International copyright laws. <br />\r\n<br />\r\nYou may not, use, reproduce, reverse engineer or create derivative works with respect to the content or creative elements of the Company''s web site. <br />\r\n<br />\r\nAll words and symbols designated by &reg; or &trade; and used on or in connection with Company products or marketing materials are trademarks owned by the Company and are protected under federal and state laws. Trademarks owned by other companies are used with the permission of their respective owners. <br />\r\n<br />\r\n<span class="textbold">Product Descriptions</span> <br />\r\n<br />\r\nThe Company attempts to be as accurate as possible in product representations and web site content. Electronic images from computer monitors may not have the same color accuracy and resolution needed to depict our products with absolute accuracy. The Company and its affiliates do not warrant that product descriptions, images and web content are free from errors. <br />\r\n<br />\r\nPlease note that images of the Company''s products on its web sites are not in the public domain and you are not permitted to copy, download, modify, redistribute or redisplay these images without prior written approval. <br />\r\n<br />\r\n<span class="textbold">Termination of Usage</span> <br />\r\n<br />\r\nThese Terms of Use are in force until terminated by either the Company or you. You may terminate these Terms of use solely by discontinuing your use and access to the Company''s web site. We may terminate these Terms of Use, or suspend your access to all or part of our web sites without notice, for any conduct that we, in our sole discretion, believe is contrary to the Company&rsquo;s best interests or is in violation of applicable local, state and federal law. <br />\r\n<br />\r\n<span class="textbold">Indemnity</span> <br />\r\n<br />\r\nYou agree to indemnify, defend and hold harmless the Company, its parents and affiliates together with their respective employees, agents, directors, officers and shareholders, from and against any and all claims, demands, actions, costs, liabilities, losses of any kind (including attorneys'' fees) arising out of your use of this web site; your failure to use the site; your breach or alleged breach of this Agreement or your breach or alleged breach of the copyright, trademark, proprietary or other rights of the Company or third parties. <br />\r\n<br />\r\n<span class="textbold">State-Specific Legal Notices</span> <br />\r\n<br />\r\nPursuant to California Civil Code Section 1789.3 and California Civil Code Section 17538, residents of California are hereby advised: <br />\r\n<br />\r\nNewport Cottages at <font size="2">4111 Buchanan Ave Riverside, CA. 92503 </font>is the provider of the electronic commercial service on this site. Although&nbsp;Newport Cottages&nbsp;reserves the right to begin charging for use of all or any portion of this site, currently there are no charges to the consumer imposed by the Company, other than the cost of products purchased on or through the site and any applicable taxes and shipping fees associated with such purchases. The charges appear for each purchase on the web pages relating to each purchase. The purchase rules are conditioned in these Terms of Use, the Privacy Policy and the Terms and Conditions of Sale. The Complaint Assistance Unit of the Division of Consumer Services of the Department of Consumer Affairs in California may be contacted in writing at 400 R. Street, Suite 3090, Sacramento, CA 95814 or at <skype:span onmouseup="javascript:skype_tb_imgOnOff(this,1,''0'',true,16,'''');return skype_tb_stopEvents();" onmousedown="javascript:skype_tb_imgOnOff(this,2,''0'',true,16,'''');return skype_tb_stopEvents();" onmouseover="javascript:skype_tb_imgOnOff(this,1,''0'',true,16,'''');" onmouseout="javascript:skype_tb_imgOnOff(this,0,''0'',true,16,'''');" iamrtl="0" context="800 952-5210" durex="0" onclick="javascript:skype_tb_doRunCMD(''call'',''0'',null,0);return skype_tb_stopEvents();" title="Call this phone number in United States of America with Skype: +18009525210" id="softomate_highlight_0" class="skype_tb_injection"><skype:span onmouseup="javascript:doSkypeFlag(this,''0'',1,1,16);return skype_tb_stopEvents();" onmousedown="javascript:doSkypeFlag(this,''0'',2,1,16);return skype_tb_stopEvents();" onmouseover="javascript:doSkypeFlag(this,''0'',1,1,16);" onmouseout="javascript:doSkypeFlag(this,''0'',0,1,16);" onclick="javascript:skype_tb_SwitchDrop(this,''0'',''sms=0'');return skype_tb_stopEvents();" style="background-image: url(file://c:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/__SkypeIEToolbar_Cache/e70d95847a8f5723cfca6b3fd9946506/static/inactive_a.compat.flex.w16.gif);" title="Skype actions" id="skype_tb_droppart_0" class="skype_tb_imgA"><skype:span style="background-image: url(file://c:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/__SkypeIEToolbar_Cache/e70d95847a8f5723cfca6b3fd9946506/static/famfamfam/US.gif);" id="skype_tb_img_f0" class="skype_tb_imgFlag"></skype:span></skype:span><skype:span id="skype_tb_img_s0" class="skype_tb_imgS"></skype:span><skype:span id="skype_tb_text0" class="skype_tb_injectionIn"><skype:span id="skype_tb_innerText0" class="skype_tb_innerText">800&nbsp;952-5210</skype:span></skype:span><skype:span id="skype_tb_img_r0" class="skype_tb_imgR"></skype:span></skype:span>.&nbsp;<br />\r\n<br />\r\nNewport Cottages reserves the right to make changes to our web site, our Privacy Policy, Terms of Use and Terms and Conditions policies at any time. Your use of www.newportcottages.com constitutes agreement with our Terms of Use Policy.', 'Privacy Policy', '', '', 1, '', 'privacypolicy.html'),
(224, '___ADMIN_EDITOR___CATALOGREQUEST', 1, '<div style="text-align: left;">\r\n<p><font face="Times" size="5" new="">Catalog Request</font><strong><br />\r\n<br />\r\nPicture Book </strong><br />\r\nYou may purchase our full color, 48 page &ldquo;Picture Book&rdquo; catalog for $12. The &ldquo;Picture Book&rdquo; includes all of our collections along with specifications and custom options. Our customized finishes are shown in full color and you will find a complete section of the appliqu&eacute; choices available for the various furniture pieces. This makes a great reference tool when planning your interior and choosing color palettes.</p>\r\n<table width="100%" cellspacing="0" cellpadding="0" border="0" align="center">\r\n    <tbody>\r\n        <tr>\r\n            <td valign="middle" align="center"><font size="2"><strong>            <br />\r\n            Purchase the Picture Book online using secure PayPal             <br />\r\n            &nbsp;</strong></font></td>\r\n        </tr>\r\n        <tr>\r\n            <td width="100%" valign="middle" align="center">\r\n            <form name="{5C088896-C4CC-4430-A6D8-9DC9D2BE379D}" method="post" action="https://www.paypal.com/cgi-bin/webscr">\r\n                <input type="hidden" value="_s-xclick" name="cmd" /> <input type="hidden" value="6363029" name="hosted_button_id" /> <input type="image" border="0" alt="PayPal - The safer, easier way to pay online!" name="submit" src="https://www.paypal.com/en_US/i/btn/btn_buynow_SM.gif" /> <img height="1" width="1" border="0" src="https://www.paypal.com/en_US/i/scr/pixel.gif" alt="" />\r\n            </form>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<br />\r\n<p><font face="Times" size="3" new=""><span><strong>Dealer Kit </strong></span><br />\r\n<font face="Verdana," size="2">This option is available to retailers, designer showrooms and trade professionals exclusively. The complete Dealer Kit includes the &ldquo;Picture Book&rdquo;, a dealer Reference Guide, any supplemental catalogs and updates, individual specification sheets for each item, price lists and a Binder to keep everything organized. We&rsquo;ll also send out a full set of painted and stained wood finish samples. The Dealer Kit is available for $45. </font></font></p>\r\n<table width="100%" cellspacing="0" cellpadding="0" border="0" align="center">\r\n    <tbody>\r\n        <tr>\r\n            <td valign="middle" align="center"><font size="2"><strong>Purchase the Dealer Kit Online using secure PayPal:<br />\r\n            &nbsp;</strong></font>\r\n            <form name="{6997CAAD-DD2E-4962-B327-2EF82056C17C}" method="post" action="https://www.paypal.com/cgi-bin/webscr">\r\n                <input type="hidden" value="_s-xclick" name="cmd" /> <input type="hidden" value="6363077" name="hosted_button_id" /> <input type="image" border="0" alt="PayPal - The safer, easier way to pay online!" name="submit" src="https://www.paypal.com/en_US/i/btn/btn_buynow_SM.gif" /> <img height="1" width="1" border="0" src="https://www.paypal.com/en_US/i/scr/pixel.gif" alt="" />\r\n            </form>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p><font face="Verdana," size="2">The purchasing of a Dealer Kit does not guarantee that you will be eligible to open an account with us. Accounts may be opened upon review of business and resale information, proximity of existing dealers, and other information. To confirm eligibility, we recommend that you first contact our Sales Department.</font></p>\r\n<p><font face="Times" size="3" new=""><span><strong>Inquiries and Site Access<br />\r\n</strong></span><font face="Verdana," size="2">Access to some of the sections on our site is restricted to retailers and trade professionals. To gain full access, please login by using the appropriate username and password.</font></font></p>\r\n<p><font face="Verdana," size="2">To request a username and password, please fill out a Password and Site Access Request Form, and we will email you login information for immediate access.</font></p>\r\n<p><font face="Verdana," size="2">For more information about Newport Cottages or to request more information, please use our <a href="http://newportcottages.com/contact.html" target="_self">Contact Us Form</a>.</font></p>\r\n</div>', 'Catalog Request', 'Catalog Request', 'Catalog Request', 1, 'Catalog-Request-from-Newport-Cottages', 'catalogrequest.html'),
(225, '___ADMIN_EDITOR___PRESSANDNEWS_MAINPAGE', 1, '<p><img height="277" width="584" src="/attachment/image/press_news_newport_cottages_celebrity.jpg" alt="" class="" /></p>\r\n<p><strong><font size="3">News Updates<br />\r\n&nbsp; </font></strong><br />\r\n<font size="2">When it comes to Hollywood nurseries, Newport Cottages is among the top names for celebrities. Based in Southern California, and catering to a handful of high-end designers and specialty baby stores, Newport Cottages is frequently chosen to furnish many celebrity nurseries.</font></p>\r\n<p><font size="2">Army Wives producers contacted Newport Cottages when looking to furnish the ideal nursery for Lieutenant Colonel Joan Burton. In search for heirloom pieces that would tie into the history of South Carolina they chose the Cottage Crib with tall posts, Samantha Changer with Roses, Storytime Bookstand and finished off with our classic Highchair.</font></p>', 'Celebrity Nurseries in the News from Newport Cottages', '', '', 1, 'press_news', 'news.html'),
(226, '___ADMIN_EDITOR___CONTACTUS', 1, '<table cellspacing="0" cellpadding="0" width="928" border="0">\r\n    <tbody>\r\n        <tr>\r\n            <td valign="top" align="left" width="100%">\r\n            <p><font face="Times New Roman, Times, serif" size="5">Contact Us&nbsp;</font></p>\r\n            <p><span id="msg"><font face="Verdana, Arial, Helvetica, sans-serif" size="2">Our Corporate Office and Factory is located in Southern California. </font></span></p>\r\n            <p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">Please contact us at the following:</font></p>\r\n            <p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">Newport Cottages<br />\r\n            4111 Buchanan Ave<br />\r\n            Riverside, CA. 92503<br />\r\n            Tel <skype:span class="skype_tb_injection" id="softomate_highlight_0" title="Call this phone number in United States of America with Skype: +19515490590" onclick="javascript:skype_tb_doRunCMD(''call'',''0'',null,0);return skype_tb_stopEvents();" durex="0" context="(951) 549-0590" iamrtl="0" onmouseout="javascript:skype_tb_imgOnOff(this,0,''0'',true,16,'''');" onmouseover="javascript:skype_tb_imgOnOff(this,1,''0'',true,16,'''');" onmousedown="javascript:skype_tb_imgOnOff(this,2,''0'',true,16,'''');return skype_tb_stopEvents();" onmouseup="javascript:skype_tb_imgOnOff(this,1,''0'',true,16,'''');return skype_tb_stopEvents();"><skype:span class="skype_tb_imgA" id="skype_tb_droppart_0" title="Skype actions" style="background-image: url(file://c:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/__SkypeIEToolbar_Cache/e70d95847a8f5723cfca6b3fd9946506/static/inactive_a.compat.flex.w16.gif)" onclick="javascript:skype_tb_SwitchDrop(this,''0'',''sms=0'');return skype_tb_stopEvents();" onmouseout="javascript:doSkypeFlag(this,''0'',0,1,16);" onmouseover="javascript:doSkypeFlag(this,''0'',1,1,16);" onmousedown="javascript:doSkypeFlag(this,''0'',2,1,16);return skype_tb_stopEvents();" onmouseup="javascript:doSkypeFlag(this,''0'',1,1,16);return skype_tb_stopEvents();"><skype:span class="skype_tb_imgFlag" id="skype_tb_img_f0" style="background-image: url(file://c:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/__SkypeIEToolbar_Cache/e70d95847a8f5723cfca6b3fd9946506/static/famfamfam/US.gif)"></skype:span></skype:span><skype:span class="skype_tb_imgS" id="skype_tb_img_s0"></skype:span><skype:span class="skype_tb_injectionIn" id="skype_tb_text0"><skype:span class="skype_tb_innerText" id="skype_tb_innerText0">(951)&nbsp;549-0590</skype:span></skype:span></skype:span> Fax (951) 549-0792<br />\r\n            <a target="_blank" href="mailto:info@newportcottages.com">info@newportcottages.com</a></font></p>\r\n            <p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">You can also contact us using our Contact Request Form.</font></p>\r\n            <p><font face="Verdana, Arial, Helvetica, sans-serif" size="2">To register your product with Newport Cottage, and to activate your product warranty<br />\r\n            visit our <a href="{BASEURL}product_registration.php">product registration page</a>. <br />\r\n            <br />\r\n            <br />\r\n            </font></p>\r\n            <form action="contact.php" method="post" onsubmit="javascript:if (!SendContactUs()) return false;" name="sendmail">\r\n                <table cellspacing="5" cellpadding="0" border="0">\r\n                    <tbody>\r\n                        <tr>\r\n                            <td>Subject:</td>\r\n                            <td><input id="subject" style="width: 200px" name="subject" type="text" /></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Your Name:<font color="#ff0000">*</font></td>\r\n                            <td><input id="name" style="width: 200px; background-color: rgb(255,255,160)" name="name" type="text" /></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Your Phone:</td>\r\n                            <td><input id="phone_no" style="width: 200px; background-color: rgb(255,255,160)" name="phone_no" type="text" /></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Your Email:<font color="#ff0000">*</font></td>\r\n                            <td><input id="email" style="width: 200px; background-color: rgb(255,255,160)" name="email" type="text" /></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Mail Message</td>\r\n                            <td><textarea id="message" rows="3" cols="40" name="message"></textarea></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>&nbsp;</td>\r\n                            <td><input type="submit" value="Send mail" /> <input type="reset" value="Reset" /></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td height="30">&nbsp;</td>\r\n                            <td>&nbsp;</td>\r\n                        </tr>\r\n                    </tbody>\r\n                </table>\r\n            </form>\r\n            </td>\r\n            <td valign="top" align="right" width="1"><img alt="" src="/attachment/image/contact(1).jpg" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>', 'Newport Cottages - Contact Us 951-549-0590', '', '', 1, '', 'contact.html'),
(227, '___ADMIN_EDITOR___JOINMAIL', 1, '<div align="center">{joinmail}</div>', 'join mail', 'join mail', 'join mail', 1, '', 'joinmail.html'),
(228, '___ADMIN_EDITOR___PRODUCTREGISTRATION', 1, '<div style="text-align: left;"><font face="Times" size="5" new="">Newport Cottages Product Warranty Details</font><br />\r\n<a target="_top" href="#2">Register Your Product</a><br />\r\n<div align="center">&nbsp;<img height="362" width="500" alt="" src="/attachment/image/product_warranty_certficate.jpg" /></div>\r\n<p align="center"><img class="" alt="" src="/newportcottages/attachment/image/product_warranty_certficate.jpg" /></p>\r\n<br />\r\n<a target="_top" href="#3">View Warranty Details</a><br />\r\n<br />\r\n<br />\r\n<font face="Times" size="5" new=""> <a name="2"></a>Online Product Registration</font> <br />\r\n{product_registration} <br />\r\n<font face="Verdana," size="2"><strong><a name="3"></a>WHAT IS NOT COVERED</strong></font><br />\r\n<font face="Verdana," size="2"> </font> <br />\r\n<font face="Verdana," size="2">Damages caused by improper shipping, assembly, installation, operation, handling, cleaning, finishing, unusual climatic conditions, unauthorized modifications, abuse or extraordinary uses of the furniture, will not be covered by this warranty. Warranty does not cover expansion, contraction, or extremes of high/low humidity, normal wear and tear. Freight and packaging charges to and from our customer service center remain the customer&rsquo;s responsibility. Labor or material charges to remove or replace parts are not covered under this warranty. Any floor sample sales or clearance sales from the store are not covered by this warranty. Wood furniture will have natural variation in grain and color, and inherent characteristics such as knots, mineral streaks, and pitch pockets, which are not considered quality defects. Due to the handcrafted nature of, and the use of natural materials in, many of our products, variations in size, shape, and color can be expected.</font> <br />\r\n<br />\r\n<font face="Verdana," size="2"><strong> YOUR RESPONSIBILITY</strong></font><br />\r\n<font face="Verdana," size="2"> Keep the original sales receipt to verify your purchase date.</font><br />\r\n<font face="Verdana," size="2"> </font><br />\r\n<font face="Verdana," size="2"> <strong>CLAIMS PROCEDURE</strong></font><br />\r\n<font face="Verdana," size="2"> </font> <br />\r\n<font face="Verdana," size="2">The duration of this warranty is limited to claims made in writing to Newport Cottages within 1 year after the purchase date. The Buyer should contact the retailer from which the furniture was purchased with any warranty claims. If that retailer is no longer in business or the Buyer no longer lives near that retailer, the Buyer may contact Newport Cottages at the address below. If requested, the Buyer must allow the retailer or Newport Cottages or its agents to inspect the furniture and the Buyer must reasonably cooperate with the retailer or Newport Cottages or its agents with respect to verifying the warranty claim. If a warranted defect is discovered, Newport Cottages will repair or replace the furniture or furniture part or return the purchase price to the Buyer, at the option of Newport Cottages. </font> <br />\r\n<br />\r\n<font face="Verdana," size="2"> </font> <br />\r\n<font face="Verdana," size="2">The buyer is responsible for any required shipping to or from Buyer''s location. Furniture returned to Newport Cottages without prior written authorization will not be accepted. </font> <br />\r\n<br />\r\n<font face="Verdana," size="2"> This warranty extends only to the Buyer and is not transferable. </font><br />\r\n<font face="Verdana," size="2"> </font><br />\r\n<font face="Verdana," size="2"> </font> <br />\r\n<font face="Verdana," size="2"><strong>IMPLIED WARRANTIES APPLICABLE TO THIS TRANSACTION EXTEND ONLY FOR 1 YEAR. SOME STATES DO NOT ALLOW LIMITATIONS ON HOW LONG AN IMPLIED WARRANTY LASTS, SO THE ABOVE LIMITATIONS MAY NOT APPLY TO YOU. </strong></font> <br />\r\n<br />\r\n<font face="Verdana," size="2"><strong> </strong></font> <br />\r\n<font face="Verdana," size="2"><strong>NEWPORT COTTAGES IS NOT RESPONSIBLE FOR ANY INCIDENTAL OR CONSEQUENTIAL DAMAGES OF BUYER. SOME STATES DO NOT ALLOW THE EXCLUSION OR LIMITATION OF INCIDENTAL OR CONSEQUENTIAL DAMAGES, SO THE ABOVE LIMITATION OR EXCLUSION MAY NOT APPLY TO YOU. </strong></font><br />\r\n<br />\r\n<font face="Verdana," size="2"><strong> </strong></font> <br />\r\n<font face="Verdana," size="2"><strong>THIS WARRANTY GIVES YOU SPECIFIC LEGAL RIGHTS, AND YOU MAY ALSO HAVE OTHER RIGHTS WHICH VARY FROM STATE TO STATE.</strong></font> <br />\r\n<br />\r\n<font face="Verdana," size="2"> </font> <br />\r\n<font face="Verdana," size="2">NEWPORT COTTAGES </font> <br />\r\n<font face="Verdana," size="2">Summertree Interiors, Inc. </font><br />\r\n<font face="Verdana," size="2"> Riverside, CA. 92503 </font></div>', 'Welcome to Newport Cottages Product Registration', '', '', 1, '', 'product_registration.html'),
(229, '___ADMIN_EDITOR___STORELOCATOR', 1, '<p><font face="Times New Roman, Times, serif" size="5">Dealer Locator</font></p>\r\n<p>Please enter your zip code to find the dealers closest to your location. You can also click on the address to get driving directions or you can visit the websites of our dealers by clicking on their web addresses.</p>', 'Newport Cottages Dealer Locator Search - Find an Authorized Dealer', '', '', 1, 'dealerlocator.html', 'storecatalor.html'),
