(389, 1, 1251177148, 8, 1, 'Tori Spelling Showcases Her Nursery', '', '<font face="Times New Roman, Times, serif" size="5">Tori Spelling                Buys Newport Cottages</font>\r\n<p><font face="Arial, Helvetica, sans-serif" size="2"><strong><font face="Times New Roman, Times, serif"><img height="323" width="259" border="1" align="right" src="/attachment/image/tori_spelling.jpg" alt="" /></font></strong></font><font face="Georgia, Times New Roman, Times, serif">Tori                      Spelling and her husband Dean McDermott chose Newport Cottages                      for baby Stella Doreen. The nursery was beautifully decorated                      and showcased on the &ldquo;Tori &amp; Dean: Home Sweet Hollywood&rdquo;                      reality show. Tori completed the nursery with the Cape Cod                      Crib adorned with the rose appliqu&eacute;s. Here is a note                      that Tori sent showing her appreciation. We would like to                      thank her and Dean for their kindness.</font></p>\r\n<font face="Georgia, Times New Roman, Times, serif"><br />\r\nWe filmed the nursery reveal for our TV show today and the                      crib looked amazing! It made all the difference in the room.                      Thank you so much for making it happen so quickly! It really                      completed the room! Thanks again. Tori</font>', 0, 0, 0, '', 'Tori Spelling Showcases Her Nursery Baby Furniture test1', 'test2', 'test3'),
(390, 1, 1247522253, 7, 1, 'Minnie Driver Press Release', '', '<font size="5" face="Times New Roman, Times, serif">Welcome Minnie Driver and Baby</font> <font size="2" face="Arial, Helvetica, sans-serif"><strong><font face="Times New Roman, Times, serif"><img border="1" hspace="10" alt="" vspace="10" align="right" width="259" height="323" src="/attachment/image/mimi_driver.jpg" /></font></strong><font face="Times New Roman, Times, serif"><br />\r\n</font></font><font size="2" face="Georgia, Times New Roman, Times, serif"><br />\r\nWhen deciding on nursery room&nbsp;furniture for her son Henry, Minnie Driver chose Newport Cottages. Looking for a warm yet stylish look she decided on the Celine Collection, which consisted of the Crib, Dresser, Nightstand and Armoire, transforming the room into the perfect nursery. We would like to thank Minnie Driver for being so thoughtful in showing her appreciation.</font>', 0, 0, 0, '', 'Unique Baby Cribs - Nursery Room Furniture', 'unique baby cribs, nursery room furniture', 'Unique baby cribs are designed at Newport Cottages, as well as nursery roon furniture'),
(391, 1, 1248929066, 6, 1, 'Kelsey Grammer & Wife Press Release', '', '<font face="Times New Roman, Times, serif" size="5">Kelsey Grammer                <br />\r\n<br />\r\n</font>                                         <font face="Arial, Helvetica, sans-serif" size="2"><strong><font face="Times New Roman, Times, serif"><img hspace="10" height="323" width="259" vspace="10" border="1" align="right" src="/attachment/image/kelsey_grammer.jpg" alt="" /></font></strong></font><font face="Georgia, Times New Roman, Times, serif" size="2">Newport                      Cottages seemed like the perfect choice for Mr. and Mrs. Kelsey                      Grammer&rsquo;s home. Loving the Tiffany collection but wanting                      to customize it was no problem. Changing the dimensions and                      adding their own personal touch made all the difference when                      ordering the Tiffany 6 Drawer Dresser, Tiffany Nightstand                      and Tiffany Mirror. </font>', 0, 0, 0, '', 'Custom Childrens Furniture for Kelsey Grammer', '', ''),
(392, 1, 1248929165, 5, 1, 'Prime Time Show Army Wives', '', '<font face="Times New Roman, Times, serif" size="5">Newport Cottages                on a Prime Time Show</font>\r\n<p><font face="Arial, Helvetica, sans-serif" size="2"><strong><font face="Times New Roman, Times, serif"><a href="http://www.newportcottages.com/press_news_army_wives.htm#"><img hspace="10" height="184" width="165" vspace="10" border="1" align="right" src="/attachment/image/army_wives_logo.jpg" alt="" /></a></font></strong></font><font face="Georgia, Times New Roman, Times, serif"><br />\r\nArmy                      Wives producers contacted Newport Cottages when looking to                      furnish the ideal nursery for Lieutenant Colonel Joan Burton.                      In search for heirloom pieces that would tie into the history                      of South Carolina they chose the Cottage Crib with tall posts,                      Samantha Changer with Roses, Storytime Bookstand and finished                      off with our classic Highchair. </font></p>', 0, 0, 0, '', 'Custom Nursery Furniture for Army Wives Show', '', ''),
(393, 1, 1251169764, 4, 1, 'People Magazine Article Halle Berry March 31,2008', '', '<font face="Times New Roman, Times, serif" size="5">Halle Berry                Buys Newport Cottages In People Magazine</font>\r\n<p><font face="Georgia, Times New Roman, Times, serif">Looking                      for something a little more traditional and classy, Halle                      Berry and Gabriel Aubry chose Newport Cottages for baby Nahla&rsquo;s                      </font></p>\r\n<p><font face="Georgia, Times New Roman, Times, serif">Hollywood Nursery. The ability to customize the color and                      design of the Panel Crib and Taylor Changer Dresser was ideal                      for them as they opted not to find out the gender of the baby.                      </font></p>\r\n<p align="center"><img width="395" height="390" alt="" src="/attachment/image/press_page_3.jpg" /></p>', 0, 0, 0, '', 'Halle Berry Buys Newport Cottages In People Magazine', 'Halle Berry baby furniture ', 'Halle Berry baby furniture '),
(394, 1, 1249259062, 3, 1, 'Pregnancy & Newborn March 2008', '', '<font face="Times New Roman, Times, serif" size="5">Pregnancy &amp;                Newborn March 2008</font>\r\n<p align="center"><img height="381" width="390" alt="" src="/attachment/image/press_page_4.jpg" /></p>', 0, 0, 0, '', 'Pregnancy & Newborn March 2008', '', ''),
(395, 1, 1249259100, 2, 1, 'Pregnancy & Newborn January 2008', '', '<font face="Times New Roman, Times, serif" size="5">Pregnancy &amp;                Newborn January 2008</font>\r\n<p align="center"><img height="381" width="390" src="/attachment/image/press_page_5.jpg" alt="" /></p>', 0, 0, 0, '', 'Pregnancy & Newborn January 2008', '', ''),
(396, 1, 1259178824, 1, 1, 'Crib Safety Letter', '', '<p align="left"><font size="5" face="Times New Roman">Newport Cottages&nbsp;issues letter in regards to crib&nbsp;safety.<br />\r\n</font><br />\r\n&nbsp;</p>\r\n<p style="margin: 0in 0in 0pt" class="MsoNormal" align="left"><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt">Dear Customers,<o:p></o:p></span></p>\r\n<p style="margin: 0in 0in 0pt" class="MsoNormal" align="left"><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt"><o:p>&nbsp;</o:p></span></p>\r\n<p style="margin: 0in 0in 0pt" class="MsoNormal" align="left"><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt">As many of you know the Consumer Product Safety Commission (CPSC) has issued a recall of more than 2.1 million Stork Craft drop-side cribs. This being announced as the largest recall in US history has caused some concerns about the safety of our cribs. We have received numerous calls from both retailers and consumers and we have assured everyone that all Newport Cottages&rsquo; crib are safe to use. The CPSC visited our facility, tested our cribs and all of them met or exceeded their standards. In addition to this, we also had an independent laboratory conduct strength testing, check for paint toxins, etc.&nbsp; Although this recall is for Stork Craft Inc., which manufactures lower end cribs overseas, the CPSC is considering changing the mandatory crib standards for drop-sides in 2010.<o:p></o:p></span></p>\r\n<p style="margin: 0in 0in 0pt" class="MsoNormal" align="left"><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt"><o:p>&nbsp;</o:p></span></p>\r\n<p style="margin: 0in 0in 0pt" class="MsoNormal" align="left"><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt">Newport Cottages switched to duel fixed gates back in August of this year due to growing concerns about drop gates. If you have a drop gate model, we recommend that you regularly check your crib and tighten any loose parts that may result from the moving gate.&nbsp; <o:p></o:p></span></p>\r\n<p style="margin: 0in 0in 0pt" class="MsoNormal" align="left"><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt"><o:p>&nbsp;</o:p></span></p>\r\n<p style="margin: 0in 0in 0pt" class="MsoNormal" align="left"><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt">Again we emphasize that we have <strong><em>never</em></strong> had a recall however we wanted to address any safety concerns in regards to our cribs. If you or your customers have any questions please feel free to contact our office. &nbsp;<o:p></o:p></span></p>\r\n<p style="margin: 0in 0in 0pt" class="MsoNormal" align="left"><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt"><o:p>&nbsp;</o:p></span></p>\r\n<p style="margin: 0in 0in 0pt" class="MsoNormal" align="left"><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt"><o:p>&nbsp;</o:p></span>&nbsp;</p>\r\n<p style="margin: 0in 0in 0pt" class="MsoNormal" align="left"><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt">Cordially,</span><span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #1f497d; font-size: 12pt"><br />\r\n<em><font face="Times New Roman">Pockets Alvarez</font></em></span>&nbsp;<br />\r\n<span style="font-family: &quot;Georgia&quot;,&quot;serif&quot;; color: #002060; font-size: 12pt">President</span></p>', 0, 0, 0, '', '', '', '');
